import React from 'react'
import { Card } from 'react-bootstrap'

const Product = (props) => {
    return (
        <Card className='my-3 py-3 rounded'>

            <a href={`/products/${props.product._id}`}></a>
            <Card.Img src={props.product.image} variant='top' ></Card.Img>
            
        </Card>
    )
}

export default Product
